import React from "react";
import { Button, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

import HeaderImg from "../image/header.webp";

const useStyles = makeStyles((theme) => ({
  header: {
    width: "100%",
    height: "500px",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  title: {
    fontSize: "24px",

    // textAlign: "center",

    color: "#fff",
  },
}));

export default function Header() {
  const classes = useStyles();

  return (
    <div
      className="header"
      style={{ backgroundImage: `url(${HeaderImg})`, height: "100vh" }}
    >
      {/* <img src={HeaderImg} alt="header" className={classes.img} /> */}
      <Typography className={classes.title}>
        Get rewarded in a flash.
      </Typography>
      <Typography className={classes.description}>
        Complete five Deals1 and claim* a $100 Gift Card from one of your
        favorite brands!
      </Typography>
      <Button color="primary" variant="contained">
        Get a Quick Start
      </Button>
      {/* <TextField id="outlined-basic" label="Name" variant="outlined" /> */}
    </div>
  );
}
